import React from 'react';
import "./Navbar.css";

const Navbar = () => {
    return (
        <nav>
            Call App
            
            <ul>
                <li>
                    Pricing
                </li>
                <li>
                    Contact
                </li>
                <li>
                    Sign In
                </li>
            </ul>
        </nav>
    );
};

export default Navbar;
